import React, { Component } from "react";
import User from "./User";

export default class Schools extends Component {
  render() {
      const{schools} = this.props;
    return (
      <div>
        {schools.map((school) => {
          return (
            <User
              key={school.id}
              name={school.schoolname}
            />
          );
        })}
      </div>
    );
  }
}
